import React from 'react'
import Avatar from './avatar'

class AvatarList extends React.Component{



    render(){

        const mainArr = [
            {
                id:1,
                name:"amul",
                field:"c++ developer",
                
            },

            {
                id:1,
                name:"pc",
                field:"java developer",
                
            },

            {
                id:1,
                name:"mohit",
                field:"jana developer",
                
            },
            {
                id:1,
                name:"suman",
                field:"fontend developer",
                
            }
        ]

       const ArrCard =  mainArr.map((data,key) => {
            return <Avatar id= {mainArr[key].id}  name = {mainArr[key].name} field = {mainArr[key].field}/>
        }
        
    )

        return(
            <div className="sec-parent">
                {ArrCard}
                
            </div>


        )
            
        
    }
}

export default AvatarList;
